const table = document.querySelector('table')
function createRow(id, symbol, name) {
    const row = document.createElement("tr")
    const idTd = document.createElement("td")
    idTd.appendChild(document.createTextNode(id))
    const symbolTd = document.createElement("td")
    symbolTd.appendChild(document.createTextNode(symbol))
    const nameTd = document.createElement("td")
    nameTd.appendChild(document.createTextNode(name))
    row.appendChild(idTd);
    row.appendChild(symbolTd);
    row.appendChild(nameTd);
    table.appendChild(row)
}

function fillData(data) {
    for (let i = 0; i < data.length; i++) {
        idData = data[i].id
        symbolData = data[i].symbol
        nameData = data[i].name
        createRow(idData, symbolData, nameData)
    }
}

function addBlue() {
    for (let i = 1; i <= 5; i++) {
        table.rows[i].style.background = 'blue'
    }
}

function findUsdt() {
    for (let row of table.rows) {
        for (let cell of row.cells) {
            if (cell.innerHTML == "usdt") {
                row.style.background = 'green'
            }
        }
    }
}

